static char __pyx_k_besselpoly_a_lmb_nu_Weighed_inte[] = "besselpoly(a, lmb, nu)\n\nWeighed integral of a Bessel function.\n\n.. math::\n\n   \\int_0^1 x^\\lambda J_v(\\nu, 2 a x) \\, dx\n\nwhere :math:`J_v` is a Bessel function and :math:`\\lambda=lmb`,\n:math:`\\nu=nu`.";
static char __pyx_k_betainc_a_b_x_Incomplete_beta_in[] = "betainc(a, b, x)\n\nIncomplete beta integral.\n\nCompute the incomplete beta integral of the arguments, evaluated\nfrom zero to x::\n\n    gamma(a+b) / (gamma(a)*gamma(b)) * integral(t**(a-1) (1-t)**(b-1), t=0..x).\n\nNotes\n-----\nThe incomplete beta is also sometimes defined without the terms\nin gamma, in which case the above definition is the so-called regularized\nincomplete beta. Under this definition, you can get the incomplete beta by\nmultiplying the result of the scipy function by beta(a, b).";
static char __pyx_k_betaincinv_a_b_y_Inverse_functio[] = "betaincinv(a, b, y)\n\nInverse function to beta integral.\n\nCompute x such that betainc(a,b,x) = y.";
static char __pyx_k_boxcox1p_x_lmbda_Compute_the_Box[] = "boxcox1p(x, lmbda)\n\nCompute the Box-Cox transformation of 1 + `x`.\n\nThe Box-Cox transformation computed by `boxcox1p` is::\n\n    y = ((1+x)**lmbda - 1) / lmbda  if lmbda != 0\n        log(1+x)                    if lmbda == 0\n\nReturns `nan` if ``x < -1``.\nReturns `-inf` if ``x == -1`` and ``lmbda < 0``.\n\nParameters\n----------\nx : array_like\n    Data to be transformed.\nlmbda : array_like\n    Power parameter of the Box-Cox transform.\n\nReturns\n-------\ny : array\n    Transformed data.\n\nNotes\n-----\n\n.. versionadded:: 0.14.0\n\nExamples\n--------\n>>> boxcox1p(1e-4, [0, 0.5, 1])\narray([  9.99950003e-05,   9.99975001e-05,   1.00000000e-04])\n>>> boxcox1p([0.01, 0.1], 0.25)\narray([ 0.00996272,  0.09645476])";
static char __pyx_k_boxcox_x_lmbda_Compute_the_Box_C[] = "boxcox(x, lmbda)\n\nCompute the Box-Cox transformation.\n\nThe Box-Cox transformation is::\n\n    y = (x**lmbda - 1) / lmbda  if lmbda != 0\n        log(x)                  if lmbda == 0\n\nReturns `nan` if ``x < 0``.\nReturns `-inf` if ``x == 0`` and ``lmbda < 0``.\n\nParameters\n----------\nx : array_like\n    Data to be transformed.\nlmbda : array_like\n    Power parameter of the Box-Cox transform.\n\nReturns\n-------\ny : array\n    Transformed data.\n\nNotes\n-----\n\n.. versionadded:: 0.14.0\n\nExamples\n--------\n>>> boxcox([1, 4, 10], 2.5)\narray([   0.        ,   12.4       ,  126.09110641])\n>>> boxcox(2, [0, 1, 2])\narray([ 0.69314718,  1.        ,  1.5       ])";
static char __pyx_k_btdtr_a_b_x_Cumulative_beta_dist[] = "btdtr(a,b,x)\n\nCumulative beta distribution.\n\nReturns the area from zero to x under the beta density function::\n\n    gamma(a+b)/(gamma(a)*gamma(b)))*integral(t**(a-1) (1-t)**(b-1), t=0..x)\n\nSee Also\n--------\nbetainc";
static char __pyx_k_btdtri_a_b_p_p_th_quantile_of_th[] = "btdtri(a,b,p)\n\np-th quantile of the beta distribution.\n\nThis is effectively the inverse of btdtr returning the value of x for which\n``btdtr(a,b,x) = p``\n\nSee Also\n--------\nbetaincinv";
static char __pyx_k_btdtria_a_p_x_Inverse_of_btdtr_v[] = "btdtria(a, p, x)\n\nInverse of btdtr vs b";
static char __pyx_k_btdtria_p_b_x_Inverse_of_btdtr_v[] = "btdtria(p, b, x)\n\nInverse of btdtr vs a";
static char __pyx_k_chdtrc_v_x_Chi_square_survival_f[] = "chdtrc(v,x)\n\nChi square survival function\n\nReturns the area under the right hand tail (from x to\ninfinity) of the Chi square probability density function with v\ndegrees of freedom::\n\n    1/(2**(v/2) * gamma(v/2)) * integral(t**(v/2-1) * exp(-t/2), t=x..inf)";
static char __pyx_k_chdtri_p_x_Inverse_to_chdtr_vs_v[] = "chdtri(p, x)\n\nInverse to chdtr vs v\n\nReturns the argument v such that ``chdtr(v, x) == p``.";
static char __pyx_k_chdtri_v_p_Inverse_to_chdtrc_Ret[] = "chdtri(v,p)\n\nInverse to chdtrc\n\nReturns the argument x such that ``chdtrc(v,x) == p``.";
static char __pyx_k_chndtr_x_df_nc_Non_central_chi_s[] = "chndtr(x, df, nc)\n\nNon-central chi square cumulative distribution function";
static char __pyx_k_chndtridf_x_p_nc_Inverse_to_chnd[] = "chndtridf(x, p, nc)\n\nInverse to chndtr vs df";
static char __pyx_k_chndtrinc_x_df_p_Inverse_to_chnd[] = "chndtrinc(x, df, p)\n\nInverse to chndtr vs nc";
static char __pyx_k_chndtrix_p_df_nc_Inverse_to_chnd[] = "chndtrix(p, df, nc)\n\nInverse to chndtr vs x";
static char __pyx_k_cosdg_x_Cosine_of_the_angle_x_gi[] = "cosdg(x)\n\nCosine of the angle x given in degrees.";
