static char __pyx_k_cotdg_x_Cotangent_of_the_angle_x[] = "cotdg(x)\n\nCotangent of the angle x given in degrees.";
static char __pyx_k_dawsn_x_Dawson_s_integral_Comput[] = "dawsn(x)\n\nDawson's integral.\n\nComputes::\n\n    exp(-x**2) * integral(exp(t**2),t=0..x).\n\nReferences\n----------\n.. [1] Steven G. Johnson, Faddeeva W function implementation.\n   http://ab-initio.mit.edu/Faddeeva";
static char __pyx_k_ellipe_m_Complete_elliptic_integ[] = "ellipe(m)\n\nComplete elliptic integral of the second kind\n\nThis function is defined as\n\n.. math:: E(m) = \\int_0^{\\pi/2} [1 - m \\sin(t)^2]^{1/2} dt\n\nParameters\n----------\nm : array_like\n    Defines the parameter of the elliptic integral.\n\nReturns\n-------\nE : ndarray\n    Value of the elliptic integral.\n\nSee Also\n--------\nellipkm1 : Complete elliptic integral of the first kind, near  m = 1\nellipk : Complete elliptic integral of the first kind\nellipkinc : Incomplete elliptic integral of the first kind\nellipeinc : Incomplete elliptic integral of the second kind";
static char __pyx_k_ellipeinc_phi_m_Incomplete_ellip[] = "ellipeinc(phi, m)\n\nIncomplete elliptic integral of the second kind\n\nThis function is defined as\n\n.. math:: E(\\phi, m) = \\int_0^{\\phi} [1 - m \\sin(t)^2]^{1/2} dt\n\nParameters\n----------\nphi : array_like\n    amplitude of the elliptic integral.\n\nm : array_like\n    parameter of the elliptic integral.\n\nReturns\n-------\nE : ndarray\n    Value of the elliptic integral.\n\nSee Also\n--------\nellipkm1 : Complete elliptic integral of the first kind, near m = 1\nellipk : Complete elliptic integral of the first kind\nellipkinc : Incomplete elliptic integral of the first kind\nellipe : Complete elliptic integral of the second kind";
static char __pyx_k_ellipj_u_m_Jacobian_elliptic_fun[] = "ellipj(u, m)\n\nJacobian elliptic functions\n\nCalculates the Jacobian elliptic functions of parameter m between\n0 and 1, and real u.\n\nParameters\n----------\nm, u\n    Parameters\n\nReturns\n-------\nsn, cn, dn, ph\n    The returned functions::\n\n        sn(u|m), cn(u|m), dn(u|m)\n\n    The value ``ph`` is such that if ``u = ellik(ph, m)``,\n    then ``sn(u|m) = sin(ph)`` and ``cn(u|m) = cos(ph)``.";
static char __pyx_k_ellipkinc_phi_m_Incomplete_ellip[] = "ellipkinc(phi, m)\n\nIncomplete elliptic integral of the first kind\n\nThis function is defined as\n\n.. math:: K(\\phi, m) = \\int_0^{\\phi} [1 - m \\sin(t)^2]^{-1/2} dt\n\nParameters\n----------\nphi : array_like\n    amplitude of the elliptic integral\n\nm : array_like\n    parameter of the elliptic integral\n\nReturns\n-------\nK : ndarray\n    Value of the elliptic integral\n\nNotes\n-----\nThis function is also called ``F(phi, m)``.\n\nSee Also\n--------\nellipkm1 : Complete elliptic integral of the first kind, near  m = 1\nellipk : Complete elliptic integral of the first kind\nellipe : Complete elliptic integral of the second kind\nellipeinc : Incomplete elliptic integral of the second kind";
static char __pyx_k_ellipkm1_p_Complete_elliptic_int[] = "ellipkm1(p)\n\nComplete elliptic integral of the first kind around m = 1\n\nThis function is defined as\n\n.. math:: K(p) = \\int_0^{\\pi/2} [1 - m \\sin(t)^2]^{-1/2} dt\n\nwhere `m = 1 - p`.\n\nParameters\n----------\np : array_like\n    Defines the parameter of the elliptic integral as m = 1 - p.\n\nReturns\n-------\nK : ndarray\n    Value of the elliptic integral.\n\nSee Also\n--------\nellipk : Complete elliptic integral of the first kind\nellipkinc : Incomplete elliptic integral of the first kind\nellipe : Complete elliptic integral of the second kind\nellipeinc : Incomplete elliptic integral of the second kind";
static char __pyx_k_erf_z_Returns_the_error_function[] = "erf(z)\n\nReturns the error function of complex argument.\n\nIt is defined as ``2/sqrt(pi)*integral(exp(-t**2), t=0..z)``.\n\nParameters\n----------\nx : ndarray\n    Input array.\n\nReturns\n-------\nres : ndarray\n    The values of the error function at the given points x.\n\nSee Also\n--------\nerfc, erfinv, erfcinv\n\nNotes\n-----\nThe cumulative of the unit normal distribution is given by\n``Phi(z) = 1/2[1 + erf(z/sqrt(2))]``.\n\nReferences\n----------\n.. [1] http://en.wikipedia.org/wiki/Error_function\n.. [2] Milton Abramowitz and Irene A. Stegun, eds.\n    Handbook of Mathematical Functions with Formulas,\n    Graphs, and Mathematical Tables. New York: Dover,\n    1972. http://www.math.sfu.ca/~cbm/aands/page_297.htm\n.. [3] Steven G. Johnson, Faddeeva W function implementation.\n   http://ab-initio.mit.edu/Faddeeva";
static char __pyx_k_erfc_x_Complementary_error_funct[] = "erfc(x)\n\nComplementary error function, 1 - erf(x).\n\nReferences\n----------\n.. [1] Steven G. Johnson, Faddeeva W function implementation.\n   http://ab-initio.mit.edu/Faddeeva";
static char __pyx_k_erfcx_x_Scaled_complementary_err[] = "erfcx(x)\n\nScaled complementary error function, exp(x^2) erfc(x).\n\nNotes\n-----\n\n.. versionadded:: 0.12.0\n\nReferences\n----------\n.. [1] Steven G. Johnson, Faddeeva W function implementation.\n   http://ab-initio.mit.edu/Faddeeva";
