static char __pyx_k_expi_x_Exponential_integral_Ei_D[] = "expi(x)\n\nExponential integral Ei\n\nDefined as::\n\n    integral(exp(t)/t,t=-inf..x)\n\nSee `expn` for a different exponential integral.";
static char __pyx_k_expit_x_Expit_ufunc_for_ndarrays[] = "expit(x)\n\nExpit ufunc for ndarrays.\n\nThe expit function, also known as the logistic function, is defined as\nexpit(x) = 1/(1+exp(-x)). It is the inverse of the logit function.\n\nParameters\n----------\nx : ndarray\n    The ndarray to apply expit to element-wise.\n\nReturns\n-------\nout : ndarray\n    An ndarray of the same shape as x. Its entries\n    are expit of the corresponding entry of x.\n\nNotes\n-----\nAs a ufunc expit takes a number of optional\nkeyword arguments. For more information\nsee `ufuncs <http://docs.scipy.org/doc/numpy/reference/ufuncs.html>`_\n\n.. versionadded:: 0.10.0";
static char __pyx_k_expm1_x_exp_x_1_for_use_when_x_i[] = "expm1(x)\n\nexp(x) - 1 for use when x is near zero.";
static char __pyx_k_fdtr_dfn_dfd_x_F_cumulative_dist[] = "fdtr(dfn, dfd, x)\n\nF cumulative distribution function\n\nReturns the area from zero to x under the F density function (also\nknown as Snedcor's density or the variance ratio density).  This\nis the density of X = (unum/dfn)/(uden/dfd), where unum and uden\nare random variables having Chi square distributions with dfn and\ndfd degrees of freedom, respectively.";
static char __pyx_k_fdtrc_dfn_dfd_x_F_survival_funct[] = "fdtrc(dfn, dfd, x)\n\nF survival function\n\nReturns the complemented F distribution function.";
static char __pyx_k_fdtridfd_dfn_p_x_Inverse_to_fdtr[] = "fdtridfd(dfn, p, x)\n\nInverse to fdtr vs dfd\n\nFinds the F density argument dfd such that ``fdtr(dfn,dfd,x) == p``.";
static char __pyx_k_fresnel_z_Fresnel_sin_and_cos_in[] = "fresnel(z)\n\nFresnel sin and cos integrals\n\nDefined as::\n\n    ssa = integral(sin(pi/2 * t**2),t=0..z)\n    csa = integral(cos(pi/2 * t**2),t=0..z)\n\nParameters\n----------\nz : float or complex array_like\n    Argument\n\nReturns\n-------\nssa, csa\n    Fresnel sin and cos integral values";
static char __pyx_k_gamma_z_Gamma_function_The_gamma[] = "gamma(z)\n\nGamma function\n\nThe gamma function is often referred to as the generalized\nfactorial since ``z*gamma(z) = gamma(z+1)`` and ``gamma(n+1) =\nn!`` for natural number *n*.";
static char __pyx_k_gammainc_a_x_Incomplete_gamma_fu[] = "gammainc(a, x)\n\nIncomplete gamma function\n\nDefined as::\n\n    1 / gamma(a) * integral(exp(-t) * t**(a-1), t=0..x)\n\n`a` must be positive and `x` must be >= 0.";
static char __pyx_k_gammaincc_a_x_Complemented_incom[] = "gammaincc(a,x)\n\nComplemented incomplete gamma integral\n\nDefined as::\n\n    1 / gamma(a) * integral(exp(-t) * t**(a-1), t=x..inf) = 1 - gammainc(a,x)\n\n`a` must be positive and `x` must be >= 0.";
static char __pyx_k_gammainccinv_a_y_Inverse_to_gamm[] = "gammainccinv(a,y)\n\nInverse to gammaincc\n\nReturns `x` such that ``gammaincc(a,x) == y``.";
static char __pyx_k_gammaincinv_a_y_Inverse_to_gamma[] = "gammaincinv(a, y)\n\nInverse to gammainc\n\nReturns `x` such that ``gammainc(a, x) = y``.";
static char __pyx_k_gammasgn_x_Sign_of_the_gamma_fun[] = "gammasgn(x)\n\nSign of the gamma function.\n\nSee Also\n--------\ngammaln";
static char __pyx_k_gdtr_a_b_x_Gamma_distribution_cu[] = "gdtr(a,b,x)\n\nGamma distribution cumulative density function.\n\nReturns the integral from zero to x of the gamma probability\ndensity function::\n\n    a**b / gamma(b) * integral(t**(b-1) exp(-at),t=0..x).\n\nThe arguments a and b are used differently here than in other\ndefinitions.";
static char __pyx_k_gdtrc_a_b_x_Gamma_distribution_s[] = "gdtrc(a,b,x)\n\nGamma distribution survival function.\n\nIntegral from x to infinity of the gamma probability density\nfunction.\n\nSee Also\n--------\ngdtr, gdtri";
static char __pyx_k_gdtria_p_b_x_out_None_Inverse_of[] = "gdtria(p, b, x, out=None)\n\nInverse of gdtr vs a.\n\nReturns the inverse with respect to the parameter `a` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution.\n\nParameters\n----------\np : array_like\n    Probability values.\nb : array_like\n    `b` parameter values of `gdtr(a, b, x)`.  `b` is the \"shape\" parameter\n    of the gamma distribution.\nx : array_like\n    Nonnegative real values, from the domain of the gamma distribution.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\na : ndarray\n    Values of the `a` parameter such that `p = gdtr(a, b, x)`.  `1/a`\n    is the \"scale\" parameter of the gamma distribution.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtrib : Inverse with respect to `b` of `gdtr(a, b, x)`.\ngdtrix : Inverse with respect to `x` of `gdtr(a, b, x)`.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtria(p, 3.4, 5.6)\n1.2";
static char __pyx_k_gdtrib_a_p_x_out_None_Inverse_of[] = "gdtrib(a, p, x, out=None)\n\nInverse of gdtr vs b.\n\nReturns the inverse with respect to the parameter `b` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution.\n\nParameters\n----------\na : array_like\n    `a` parameter values of `gdtr(a, b, x)`. `1/a` is the \"scale\"\n    parameter of the gamma distribution.\np : array_like\n    Probability values.\nx : array_like\n    Nonnegative real values, from the domain of the gamma distribution.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\nb : ndarray\n    Values of the `b` parameter such that `p = gdtr(a, b, x)`.  `b` is\n    the \"shape\" parameter of the gamma distribution.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtria : Inverse with respect to `a` of `gdtr(a, b, x)`.\ngdtrix : Inverse with respect to `x` of `gdtr(a, b, x)`.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtrib(1.2, p, 5.6)\n3.3999999999723882";
static char __pyx_k_gdtrix_a_b_p_out_None_Inverse_of[] = "gdtrix(a, b, p, out=None)\n\nInverse of gdtr vs x.\n\nReturns the inverse with respect to the parameter `x` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution. This is also known as the p'th quantile of the\ndistribution.\n\nParameters\n----------\na : array_like\n    `a` parameter values of `gdtr(a, b, x)`.  `1/a` is the \"scale\"\n    parameter of the gamma distribution.\nb : array_like\n    `b` parameter values of `gdtr(a, b, x)`.  `b` is the \"shape\" parameter\n    of the gamma distribution.\np : array_like\n    Probability values.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\nx : ndarray\n    Values of the `x` parameter such that `p = gdtr(a, b, x)`.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtria : Inverse with respect to `a` of `gdtr(a, b, x)`.\ngdtrib : Inverse with respect to `b` of `gdtr(a, b, x)`.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtrix(1.2, 3.4, p)\n5.5999999999999996";
static char __pyx_k_hankel1_v_z_Hankel_function_of_t[] = "hankel1(v, z)\n\nHankel function of the first kind\n\nParameters\n----------\nv : float\n    Order\nz : float or complex\n    Argument";
static char __pyx_k_hankel1e_v_z_Exponentially_scale[] = "hankel1e(v, z)\n\nExponentially scaled Hankel function of the first kind\n\nDefined as::\n\n    hankel1e(v,z) = hankel1(v,z) * exp(-1j * z)\n\nParameters\n----------\nv : float\n    Order\nz : complex\n    Argument";
static char __pyx_k_hankel2_v_z_Hankel_function_of_t[] = "hankel2(v, z)\n\nHankel function of the second kind\n\nParameters\n----------\nv : float\n    Order\nz : complex\n    Argument";
static char __pyx_k_hankel2e_v_z_Exponentially_scale[] = "hankel2e(v, z)\n\nExponentially scaled Hankel function of the second kind\n\nDefined as::\n\n    hankel1e(v,z) = hankel1(v,z) * exp(1j * z)\n\nParameters\n----------\nv : float\n    Order\nz : complex\n    Argument";
static char __pyx_k_huber_delta_r_Huber_loss_functio[] = "huber(delta, r)\n\nHuber loss function.\n\n.. math:: \\text{huber}(\\delta, r) = \\begin{cases} \\infty & \\delta < 0  \\\\ \\frac{1}{2}r^2 & 0 \\le \\delta, | r | \\le \\delta \\\\ \\delta ( |r| - \\frac{1}{2}\\delta ) & \\text{otherwise} \\end{cases}\n\nParameters\n----------\ndelta : ndarray\n    Input array, indicating the quadratic vs. linear loss changepoint.\nr : ndarray\n    Input array, possibly representing residuals.\n\nReturns\n-------\nres : ndarray\n    The computed Huber loss function values.\n\nNotes\n-----\nThis function is convex in r.\n\n.. versionadded:: 0.15.0";
