static char __pyx_k_ncfdtr_dfn_dfd_nc_f_Cumulative_d[] = "ncfdtr(dfn, dfd, nc, f)\n\nCumulative distribution function of the non-central F distribution.\n\nParameters\n----------\ndfn : array_like\n    Degrees of freedom of the numerator sum of squares.  Range (0, inf).\ndfd : array_like\n    Degrees of freedom of the denominator sum of squares.  Range (0, inf).\nnc : array_like\n    Noncentrality parameter.  Should be in range (0, 1e4).\nf : array_like\n    Quantiles, i.e. the upper limit of integration.\n\nReturns\n-------\ncdf : float or ndarray\n    The calculated CDF.  If all inputs are scalar, the return will be a\n    float.  Otherwise it will be an array.\n\nSee Also\n--------\nncdfdtri : Inverse CDF (iCDF) of the non-central F distribution.\nncdfdtridfd : Calculate dfd, given CDF and iCDF values.\nncdfdtridfn : Calculate dfn, given CDF and iCDF values.\nncdfdtrinc : Calculate noncentrality parameter, given CDF, iCDF, dfn, dfd.\n\nExamples\n--------\n>>> from scipy import special\n>>> from scipy import stats\n>>> import matplotlib.pyplot as plt\n\nPlot the CDF of the non-central F distribution, for nc=0.  Compare with the\nF-distribution from scipy.stats:\n\n>>> x = np.linspace(-1, 8, num=500)\n>>> dfn = 3\n>>> dfd = 2\n>>> ncf_stats = stats.f.cdf(x, dfn, dfd)\n>>> ncf_special = special.ncfdtr(dfn, dfd, 0, x)\n\n>>> fig = plt.figure()\n>>> ax = fig.add_subplot(111)\n>>> ax.plot(x, ncf_stats, 'b-', lw=3)\n>>> ax.plot(x, ncf_special, 'r-')\n>>> plt.show()";
static char __pyx_k_ncfdtri_p_dfn_dfd_nc_Inverse_cum[] = "ncfdtri(p, dfn, dfd, nc)\n\nInverse cumulative distribution function of the non-central F distribution.\n\nSee `ncfdtr` for more details.";
static char __pyx_k_nctdtr_df_nc_t_Cumulative_distri[] = "nctdtr(df, nc, t)\n\nCumulative distribution function of the non-central t distribution.\n\nParameters\n----------\ndf : array_like\n    Degrees of freedom of the distribution.  Should be in range (0, inf).\nnc : array_like\n    Noncentrality parameter.  Should be in range (-1e6, 1e6).\nt : array_like\n    Quantiles, i.e. the upper limit of integration.\n\nReturns\n-------\ncdf : float or ndarray\n    The calculated CDF.  If all inputs are scalar, the return will be a\n    float.  Otherwise it will be an array.\n\nSee Also\n--------\nnctdtrit : Inverse CDF (iCDF) of the non-central t distribution.\nnctdtridf : Calculate degrees of freedom, given CDF and iCDF values.\nnctdtrinc : Calculate non-centrality parameter, given CDF iCDF values.\n\nExamples\n--------\n>>> from scipy import special\n>>> from scipy import stats\n>>> import matplotlib.pyplot as plt\n\nPlot the CDF of the non-central t distribution, for nc=0.  Compare with the\nt-distribution from scipy.stats:\n\n>>> x = np.linspace(-5, 5, num=500)\n>>> df = 3\n>>> nct_stats = stats.t.cdf(x, df)\n>>> nct_special = special.nctdtr(df, 0, x)\n\n>>> fig = plt.figure()\n>>> ax = fig.add_subplot(111)\n>>> ax.plot(x, nct_stats, 'b-', lw=3)\n>>> ax.plot(x, nct_special, 'r-')\n>>> plt.show()";
static char __pyx_k_nctdtridf_p_nc_t_Calculate_degre[] = "nctdtridf(p, nc, t)\n\nCalculate degrees of freedom for non-central t distribution.\n\nSee `nctdtr` for more details.\n\nParameters\n----------\np : array_like\n    CDF values, in range (0, 1].\nnc : array_like\n    Noncentrality parameter.  Should be in range (-1e6, 1e6).\nt : array_like\n    Quantiles, i.e. the upper limit of integration.";
