static char __pyx_k_rel_entr_x_y_Elementwise_functio[] = "rel_entr(x, y)\n\nElementwise function for computing relative entropy.\n\n.. math:: \\mathrm{rel\\_entr}(x, y) = \\begin{cases} x \\log(x / y) & x > 0, y > 0 \\\\ 0 & x = 0, y \\ge 0 \\\\ \\infty & \\text{otherwise} \\end{cases}\n\nParameters\n----------\nx : ndarray\n    First input array.\ny : ndarray\n    Second input array.\n\nReturns\n-------\nres : ndarray\n    Output array.\n\nSee Also\n--------\nentr, kl_div\n\nNotes\n-----\nThis function is jointly convex in x and y.\n\n.. versionadded:: 0.14.0";
