static char __pyx_k_shichi_x_Hyperbolic_sine_and_cos[] = "shichi(x)\n\nHyperbolic sine and cosine integrals\n\nReturns\n-------\nshi\n    ``integral(sinh(t)/t, t=0..x)``\nchi\n    ``eul + ln x + integral((cosh(t)-1)/t, t=0..x)``\n    where ``eul`` is Euler's constant.";
